package javaCommands;

public class Subtraction {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 45;
		int j = 12;
		int z = i-j;
		System.out.println(z); 
		
		int a = 45;
		int b = 12;
		int c = a*b;
		System.out.println(c); 
		
		int e = 45;
		int f = 12;
		int g = e/f;
		System.out.println(g); 
	}

}
